      {/* <h4>{props.volumeInfo.subtitle}</h4> */}
      {/* <h5>Authors: {props.volumeInfo.authors}</h5> */}
      <div><img src={props.volumeInfo.image} alt="temp"></img></div>
      <div>Information: {props.info}</div>
    </div>
  );
}

export default Book;
